    public static function getProvinceByCityName($cityname) {
        $cityList = self::getCityList();
        foreach ($cityList as $key => $value) {
            if($value['city_name'] == $cityname) {
                return $value['province_name'];
            }
        }
        return '';
    }

    public static function getCityByCoord($lo,$la){
        $lo = (double)$lo;
        $la = (double)$la;
        $city_list = self::getCityList();
        $disarr = array();
        foreach ($city_list as $id=>$city){
            $city['center_latitude'] = (double)$city['center_latitude'];
            $city['center_longitude'] = (double)$city['center_longitude'];
            $distance = acos(sin(($la* M_PI) / 180 )*sin(($city['center_latitude'] * M_PI) / 180 ) + cos(($la* M_PI) / 180 ) * cos(($city['center_latitude'] * M_PI) / 180) *cos(($lo* M_PI) / 180 - ($city['center_longitude'] * M_PI) / 180 ) ) * 6380;
            $disarr[$id] = $distance ;
        }
        asort($disarr);
        $i = 0;
        foreach($disarr as $k=>$v){
            if($i<=0){
                $cid = $k;
            }else{
                break;
            }
            $i++;
        }
        $city_list[$cid]['cid'] = $cid;
        return $city_list[$cid];
    }

    public static function getCityById($cid){
        $citylist = self::getCityList();
        return isset($citylist[$cid])?$citylist[$cid]:'';
    }

    public static function getCityByName($cityname){
        $cityname = preg_replace('/(省|市|自治州|地区|特别行政区)/', '', $cityname);
        foreach (self::getCityList() as $cid => $city) {
            if($city['city_name'] == $cityname){
                $city['cid'] = $cid;
                return $city;
            }
        }
        return false;
    }

    public static function getCityByStandardCode($citycode , $returnobj = true){
        $standardcitylist = self::getStandardCityList();
        if(!isset($standardcitylist[$citycode])){
        	return '';
        }
        if(!$returnobj){
            return preg_replace('/(省|市|自治州|地区|特别行政区)/', '', $standardcitylist[$citycode]);
        }else{
            return self::getCityByName($standardcitylist[$citycode]);
        }

    }

    public static function getStandardCodeByCityId($city_id){
    	$city = self::getCityById($city_id);
    	if(!$city){
    		return '';
    	}
    	$standardcitylist = self::getStandardCityList();
    	$citycode = 0;
    	foreach ($standardcitylist as $code => $name) {
    		if(strstr($name, $city['city_name']) !== false){
    			$citycode = $code;
    			$is_prov = $code % 10000;
    			if($is_prov != 0){
    				break;
    			}
    		}
    	}
		$city['city_code'] =  $citycode;
		return $city;
    }

